[temperature_sensor EBB36]
sensor_type: temperature_mcu
sensor_mcu: EBB36

[temperature_sensor Chamber]
sensor_type: Generic 3950
sensor_pin: PB0

[temperature_sensor TMC5160]
sensor_type: Generic 3950
sensor_pin: PC5

[temperature_sensor AMotor]
sensor_type: Generic 3950
sensor_pin: PC4

#[temperature_sensor RapidoHeatSink]
#sensor_type: Generic 3950
