#####################################################################
#   Homing and Gantry Adjustment Routines
#####################################################################

[idle_timeout]
timeout: 1800

[quad_gantry_level]
gantry_corners:
   -60,-10
   410,420
#  Probe points
points:
   50,50
   50,300
   300,300
   300,50
      
speed: 500
horizontal_move_z: 5
retries: 10
retry_tolerance: 0.006
max_adjust: 10

[bed_mesh]
speed: 500
horizontal_move_z: 5
mesh_min: 40, 40
mesh_max: 310,310
probe_count: 101,101
mesh_pps: 2,2
algorithm: bicubic
#relative_reference_index: 5101

[firmware_retraction]
# G10 to retract and G11 to unrectract
retract_length: 0.4
# unretract_extra_length: 0
retract_speed: 30
unretract_speed: 30

[input_shaper]
# Supported shapers: zv, mzv, zvd, ei, 2hump_ei, 3hump_ei
#shaper_type_x: zv
#shaper_freq_x: 49.4
#shaper_type_y: ei
#shaper_freq_y: 39.0
damping_ratio_x: 0.05
damping_ratio_y: 0.06

[gcode_shell_command plot_graph]
command: bash /home/pi/printer_data/config/scripts/plot_graphs.sh
timeout: 500.0
verbose: True

[gcode_shell_command set_manual_focus]
command: bash /home/pi/set_manual_focus.sh
timeout: 500.0
verbose: True

